import React, {useEffect, useState} from 'react';
// import {Link} from 'react-router-dom';

function Tweet() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        const data = await fetch('http://localhost:4000/votes');
        console.log("harsha", data);
        const items = await data.json();
        setItems(items);
    };

    return(
        <section>   
            <div class="container-fluid">
                <h1 class="mt-5">Votes Table</h1>
                {
                items.map(item => (
                    <div class="row padding">
                        <div class="alert alert-info rounded-pill" role="alert">
                            <i class="fa fa-user mr-2"></i> <i>{item.name} ({item.voting_choice}): {item.casted_at}</i>
                        </div>
                    </div>       
                ))
                }
            </div>
        </section>
    );
}

export default Tweet;
